DROP TABLE IF EXISTS `weather_cache`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `weather_cache` (
  `id` int NOT NULL AUTO_INCREMENT,
  `base_date` varchar(8) NOT NULL COMMENT '발표일자 YYYYMMDD',
  `base_time` varchar(4) NOT NULL COMMENT '발표시각 HHmm',
  `fcst_date` varchar(8) NOT NULL COMMENT '예보일자 YYYYMMDD',
  `fcst_time` varchar(4) NOT NULL COMMENT '예보시각 HHmm',
  `nx` int NOT NULL COMMENT '격자 X',
  `ny` int NOT NULL COMMENT '격자 Y',
  `fetched_at` bigint NOT NULL COMMENT 'Unix timestamp',
  `tmp` float DEFAULT NULL COMMENT '1시간 기온 (℃)',
  `tmn` float DEFAULT NULL COMMENT '일 최저기온 (℃)',
  `tmx` float DEFAULT NULL COMMENT '일 최고기온 (℃)',
  `pop` int DEFAULT NULL COMMENT '강수확률 (%)',
  `pty` int DEFAULT NULL COMMENT '강수형태 (0:없음 1:비 2:비/눈 3:눈 5:빗방울 6:빗방울눈날림 7:눈날림)',
  `pcp` varchar(20) DEFAULT NULL COMMENT '1시간 강수량 (mm)',
  `sno` varchar(20) DEFAULT NULL COMMENT '1시간 신적설 (cm)',
  `sky` int DEFAULT NULL COMMENT '하늘상태 (1:맑음 3:구름많음 4:흐림)',
  `vec` int DEFAULT NULL COMMENT '풍향 (deg)',
  `wsd` float DEFAULT NULL COMMENT '풍속 (m/s)',
  `uuu` float DEFAULT NULL COMMENT '동서바람성분 (m/s)',
  `vvv` float DEFAULT NULL COMMENT '남북바람성분 (m/s)',
  `reh` int DEFAULT NULL COMMENT '습도 (%)',
  `wav` float DEFAULT NULL COMMENT '파고 (M)',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_weather` (`base_date`,`base_time`,`nx`,`ny`,`fcst_date`,`fcst_time`),
  KEY `idx_fetched_at` (`fetched_at`),
  KEY `idx_forecast` (`fcst_date`,`fcst_time`)
) ENGINE=InnoDB AUTO_INCREMENT=5765 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='KMA 단기예보 캐시 (시간대별)';
/*!40101 SET character_set_client = @saved_cs_client */;

